import React from 'react'
import Button from '../Button/Button';
import "./card.css";

function Card(props) {

  return (
    <div className='card'>
        <div className='card-img'>
           <img src={props.img} alt="card img" />
        </div>
        <div className='card-detail'>
            <h3>{props.title}</h3>
            <p>Descripción</p>
            <h4>$ {props.price}</h4>
        </div>
       <Button text="Ver más" />
    </div>
  )
}

export default Card
